// App.js
import React from 'react';
import './App.css';
import Header from './components/Header';
import Routes from './Routes';

function App() {
  return (
    <div className="app">
      <Header />
      <main className="app-content">
        <Routes />
      </main>
    </div>
  );
}

export default App;
